import React from "react";

import classes from "./Key.module.css";
import { IoClose } from "react-icons/io5";

const Key = (props) => {
  const removeKeyHandler = (event) => {
    console.log(event.parent.id);
  };

  return (
    <li id={props.id} className={classes.key}>
      <span className={classes.key__text}>{props.content}</span>
      <IoClose onClick={removeKeyHandler} className={classes.key__delete} />
    </li>
  );
};

export default Key;
